  {ordine: 1, contenuto: "<h1><a href=\"http://www.qumran2.net\">Mega titolone</a></h1>\n\n<p style=\"text-align: justify;\">Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello <span style=\"color:#FFD700;\">scrivere</span>!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere!&nbsp;Bello scrivere! dddBello scriv</p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n\t<tbody>\n\t\t<tr>\n\t\t\t<td style=\"width:151px;\">\n\t\t\t<p><strong>GENERALE</strong></p>\n\t\t\t</td>\n\t\t\t<td style=\"width:491px;\">\n\t\t\t<p>&nbsp;</p>\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style=\"width:151px;\">\n\t\t\t<p>/interface ethernet</p>\n\t\t\t</td>\n\t\t\t<td style=\"width:491px;\">\n\t\t\t<p>Configurazione delle singole porte: una verso il router Telecom e una verso la rete locale</p>\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style=\"width:151px;\">\n\t\t\t<p>/ip address</p>\n\t\t\t</td>\n\t\t\t<td style=\"width:491px;\">\n\t\t\t<p>Definisce i range di indirizzi utilizzati dalle varie interfacce, e l&rsquo;ip pubblico dei vari server locali</p>\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style=\"width:151px;\">\n\t\t\t<p>/ip route</p>\n\t\t\t</td>\n\t\t\t<td style=\"width:491px;\">\n\t\t\t<p>Specifica l&rsquo;indirizzo del gateway (il router Telecom).</p>\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style=\"width:151px;\">\n\t\t\t<p>/ip dns</p>\n\t\t\t</td>\n\t\t\t<td style=\"width:491px;\">\n\t\t\t<p>Specifica i server dns di inoltro (google)</p>\n\t\t\t</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style=\"width:151px;\">\n\t\t\t<p>/ip dns static</p>\n\t\t\t</td>\n\t\t\t<td style=\"width:491px;\">\n\t\t\t<p>Definisce delle associa